import React, { useState, useEffect } from 'react';
import {
  Box,
  TextField,
  Button,
  Grid,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  MenuItem,
  Chip,
} from '@mui/material';
import axios from 'axios';

const positions = ['', 'G', 'F', 'C', 'PG', 'SG', 'SF', 'PF'];

const AdvancedPlayerSearch = () => {
  const [searchCriteria, setSearchCriteria] = useState({
    min_points: '',
    min_rebounds: '',
    min_assists: '',
    position: '',
  });
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setSearchCriteria(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = async () => {
    setLoading(true);
    setError(null);
    setResults([]); // Clear previous results

    try {
      const params = new URLSearchParams();
      Object.entries(searchCriteria).forEach(([key, value]) => {
        // Only append non-empty values, and handle position specially
        if (value !== '' && value !== null && value !== undefined) {
          // For position, only send if it's not the empty option
          if (key !== 'position' || value !== '') {
            params.append(key, value);
          }
        }
      });

      const url = `http://localhost:5000/api/players/search?${params}`;
      console.log('Making request to:', url);

      const response = await axios.get(url);
      console.log('API Response Data:', response.data);

      if (!response.data) {
        setError('No data received from server');
        return;
      }

      // Ensure we have an array of players and it's not empty
      const playerData = Array.isArray(response.data) ? response.data : [];

      if (playerData.length === 0) {
        setError(`No players found for the specified criteria`);
      } else {
        console.log('Found players:', playerData.length);
        setResults(playerData);
      }
    } catch (error) {
      console.error('Error searching players:', error);
      setError(error.message || 'Failed to search players');
    } finally {
      setLoading(false);
    }
  };

  // Add a useEffect to monitor results changes
  useEffect(() => {
    console.log('Results state updated:', results.length, 'players');
  }, [results]);

  const renderTable = () => {
    if (!results || results.length === 0) {
      return null;
    }

    // Sort results by points in descending order
    const sortedResults = [...results].sort((a, b) => (b.points || 0) - (a.points || 0));

    return (
      <Box>
        <Typography variant="subtitle1" gutterBottom>
          Showing {sortedResults.length} players sorted by points per game
        </Typography>
        <TableContainer component={Paper} sx={{ maxHeight: '70vh', overflow: 'auto' }}>
          <Table stickyHeader>
            <TableHead>
              <TableRow>
                <TableCell>Rank</TableCell>
                <TableCell>Player</TableCell>
                <TableCell>Position</TableCell>
                <TableCell>Team</TableCell>
                <TableCell align="right">PPG</TableCell>
                <TableCell align="right">RPG</TableCell>
                <TableCell align="right">APG</TableCell>
                <TableCell align="right">FG%</TableCell>
                <TableCell align="right">3P%</TableCell>
                <TableCell align="right">GP</TableCell>
                <TableCell align="right">MPG</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {sortedResults.map((player, index) => {
                // Format numeric values with proper null checks
                const formatNumber = (value) => value !== null && value !== undefined ? Number(value).toFixed(1) : 'N/A';
                const formatPercentage = (value) => value !== null && value !== undefined ? `${Number(value).toFixed(1)}%` : 'N/A';

                return (
                  <TableRow 
                    key={`${player.name}-${player.team}-${index}`}
                    sx={{
                      backgroundColor: index < 3 ? 'rgba(144, 202, 249, 0.08)' : 'inherit',
                    }}
                  >
                    <TableCell>
                      {index + 1}
                      {index < 3 && (
                        <Chip
                          size="small"
                          label={['ðŸ¥‡', 'ðŸ¥ˆ', 'ðŸ¥‰'][index]}
                          sx={{ ml: 1 }}
                        />
                      )}
                    </TableCell>
                    <TableCell>
                      <Typography variant="body2" fontWeight={index < 3 ? 'bold' : 'normal'}>
                        {player.name}
                      </Typography>
                    </TableCell>
                    <TableCell>{player.position || 'Unknown'}</TableCell>
                    <TableCell>{player.team || 'Unknown'}</TableCell>
                    <TableCell align="right" sx={{ fontWeight: 'bold' }}>{formatNumber(player.points)}</TableCell>
                    <TableCell align="right">{formatNumber(player.rebounds)}</TableCell>
                    <TableCell align="right">{formatNumber(player.assists)}</TableCell>
                    <TableCell align="right">{formatPercentage(player.fieldGoalPercentage)}</TableCell>
                    <TableCell align="right">{formatPercentage(player.threePointPercentage)}</TableCell>
                    <TableCell align="right">{player.gamesPlayed}</TableCell>
                    <TableCell align="right">{formatNumber(player.minutesPerGame)}</TableCell>
                  </TableRow>
                );
              })}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>
    );
  };

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Advanced Player Search
      </Typography>

      <Paper sx={{ p: 3, mb: 3 }}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Points"
              name="min_points"
              type="number"
              value={searchCriteria.min_points}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Rebounds"
              name="min_rebounds"
              type="number"
              value={searchCriteria.min_rebounds}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              label="Min Assists"
              name="min_assists"
              type="number"
              value={searchCriteria.min_assists}
              onChange={handleChange}
              inputProps={{ min: 0, step: 0.1 }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <TextField
              fullWidth
              select
              label="Position"
              name="position"
              value={searchCriteria.position}
              onChange={handleChange}
            >
              {positions.map((pos) => (
                <MenuItem key={pos} value={pos}>
                  {pos || 'Any Position'}
                </MenuItem>
              ))}
            </TextField>
          </Grid>
          <Grid item xs={12} sm={6} md={2.4}>
            <Button
              fullWidth
              variant="contained"
              onClick={handleSearch}
              disabled={loading}
              sx={{ height: '100%' }}
            >
              Search
            </Button>
          </Grid>
        </Grid>
      </Paper>

      {error && (
        <Typography color="error" sx={{ mb: 2 }}>
          {error}
        </Typography>
      )}

      {loading && (
        <Typography sx={{ mb: 2 }}>
          Loading...
        </Typography>
      )}

      {!loading && !error && renderTable()}
    </Box>
  );
};

export default AdvancedPlayerSearch;
